import React from "react";

class Box extends React.Component {
  render() {
    return (
      <div class="center">
        <span class="border border-danger">
          <p>Your balance is:</p>
          <button>Increment</button>
          <button>Decrement</button>
          <button>Reset</button>
        </span>
      </div>
    );
  }
}

export default Box;
